import React from "react";
import './styles.css';

const About=()=>{
    return (
        <div class="about" id="about">
            <div class="about__container">
                <h2>Who Am I?</h2>
                <div class="about__content">
                    <img src="IMG_5405.JPG" class="about-img" alt=""/>
                    <p>I am currently a senior at Boston University and majoring in Computer Science.</p>
                </div>
            </div>
        </div>
    )
}

export default About;
